import { Routes, Route } from 'react-router-dom';

import Home from './routes/home/home.component';

const Poop = () => {
  return <h4>I Pooped</h4>;
};
const App = () => {  
  return (
    <Routes>
      <Route path='/' element={<Home/>} />
      <Route path='/poop' element={<Poop/>} />
    </Routes>
  );
};

export default App;
